import {Roboto_400Regular} from '@expo-google-fonts/roboto';
import {OpenSans_400Regular} from '@expo-google-fonts/open-sans';
import {Itim_400Regular} from '@expo-google-fonts/itim';
import {Lato_400Regular} from '@expo-google-fonts/lato';
import {Montserrat_400Regular} from '@expo-google-fonts/montserrat';
import {RobotoCondensed_400Regular} from '@expo-google-fonts/roboto-condensed';
import {Oswald_400Regular} from '@expo-google-fonts/oswald';
import {Raleway_400Regular} from '@expo-google-fonts/raleway';
import {Ubuntu_400Regular} from '@expo-google-fonts/ubuntu';
import {Lora_400Regular} from '@expo-google-fonts/lora';
import {Rubik_400Regular} from '@expo-google-fonts/rubik';
import {FiraSans_400Regular} from '@expo-google-fonts/fira-sans';
import {Quicksand_400Regular} from '@expo-google-fonts/quicksand';
import {Oxygen_400Regular} from '@expo-google-fonts/oxygen';
import {Lobster_400Regular} from '@expo-google-fonts/lobster';
import {Comfortaa_400Regular} from '@expo-google-fonts/comfortaa';
import {Cairo_400Regular} from '@expo-google-fonts/cairo';
import {Cinzel_400Regular} from '@expo-google-fonts/cinzel';
import {AbrilFatface_400Regular} from '@expo-google-fonts/abril-fatface';
import {BebasNeue_400Regular} from '@expo-google-fonts/bebas-neue';
import {MavenPro_400Regular} from '@expo-google-fonts/maven-pro';

export const fonts = {
	'Itim': Itim_400Regular,
	'Open Sans': OpenSans_400Regular,
	'Roboto': Roboto_400Regular,
	//Sant-serif
	'Lato': Lato_400Regular,
	'Montserrat': Montserrat_400Regular,
	'Roboto Condensed': RobotoCondensed_400Regular,
	'Oswald': Oswald_400Regular,
	'Raleway': Raleway_400Regular,
	'Ubuntu': Ubuntu_400Regular,
	'Lora': Lora_400Regular,
	'Rubik': Rubik_400Regular,
	'Fira Sans': FiraSans_400Regular,
	'Quicksand': Quicksand_400Regular,
	'Oxygen': Oxygen_400Regular,
	'Lobster': Lobster_400Regular,
	'Comfortaa': Comfortaa_400Regular,
	'Cairo': Cairo_400Regular,
	'Cinzel': Cinzel_400Regular,
	'Abril Fatface': AbrilFatface_400Regular,
	'Bebas Neue': BebasNeue_400Regular,
	'Maven Pro': MavenPro_400Regular,
	'SF Pro Display': 'https://fontsfree.net//wp-content/fonts/basic/sans-serif/FontsFree-Net-SFProDisplay-Regular.ttf',
	'SF Pro Text': 'https://fontsfree.net//wp-content/fonts/basic/sans-serif/FontsFree-Net-SFProText-Regular.ttf',
	'SF Pro Rounded': 'https://fontsfree.net//wp-content/fonts/basic/sans-serif/FontsFree-Net-SF-Pro-Rounded-Regular.ttf',
	'SF Pro Text-Medium': 'https://fontsfree.net//wp-content/fonts/basic/sans-serif/FontsFree-Net-SFProText-Medium.ttf'
}
